import React from "react";
import Container from "react-bootstrap/Container";
import ContentForm from "../form/ContentForm";

function Contact() {
  return (
    <div>
      <Container>
        <h1>Contact</h1>
        <ContentForm />
      </Container>
    </div>
  );
}

export default Contact;
